import React from 'react';
import './App.css';
import QuizForm from './Quiz/QuizForm/QuizForm';

const colors = {
  blue: "#03619c",
  green: "#009900",
  red: "#9c0312"
};

export const ColorContext = React.createContext(null);

const [highlight, setHighLight] = React.useState(null);

const value = React.useMemo(() => ({ highlight, setHighLight }), [highlight, setHighLight]);



function App() {

     return (
       <div>
         <ColorContext.Provider value={value}>
           <QuizForm />
          </ColorContext.Provider>

      </div>
  );
}

export default App;
